@HappyBadgerUK @CER_Grant @CER_EU It is perhaps reasonable to say that the EU attitude to/interpretation of the Ulster conundrum is not exactly the same as ours. 

Lost in Translation comes to mind. 

Well worth a clarification "in plain English" - bitte.

@HappyBadgerUK @CER_Grant @GuitarMoog @CER_EU Love to spend more time conversing with you, pal  -  but I have Dulux to watch drying, so I will bid you a very short farewell.

I do get the impression, though, that you are happiest just talking to yourself in any case.

Merry Christmas.

@HappyBadgerUK @CER_Grant @GuitarMoog @CER_EU Yes I have, actually  -  and I know when I am conversing with a supercilious idiot.

Move along please, there's a good wee troll.

Ta.
